import Card from "../UI/Card/card";
import Currentweather from "./currentweather/currentweather";
import NextWeekWeather from "./nextWeekWeather/nextWeekWeather";
import SearchBar from "./searchBar/SearchBar";
import Classes from "./main.module.css";
import FavoritesButton from "../UI/favoritesButton/favoritesButton";

const Main = (props) => {
  return (
    <main className={Classes.mainPage}>
      <SearchBar />
      <Card class={Classes.mainCard}>
        <FavoritesButton id="5" />
        <NextWeekWeather />
        <Currentweather />
      </Card>
    </main>
  );
};

export default Main;

Main.defaultProps = {
  city: "Tel Aviv",
  temperature: "30",
  WeatherText: "Cloudy",
  icon: "https://www.svgrepo.com/show/44083/cloudy.svg",
};
